import "./posts.styles.scss";
import postDatas from "../../postData.json";

const Posts = () => {
  const postID = (id) => {
    console.log(id);
  };

  return (
    <div className="postsContainer">
      {postDatas.map((data) => {
        return (
          <div
            className="postsContentsContainer"
            onClick={postID(data.ID)}
            key={data.ID}>
            <p>{data.postDescription}</p>
            <hr />
            <div>
              <div>{data.likedBy.length} Liked</div>
              <div>Comment</div>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default Posts;
